window.bookSummaryJSON = "<p><b>Sometimes the difference between a love story and a horror story is where the ending comes....</b></p> <p>While Jude fought for power in the Court of Elfhame against the cruel Prince Cardan, her sister, Taryn, began to fall in love with the trickster Locke.</p> <p>Half-apology and half-explanation, it turns out Taryn has some secrets of her own to reveal.</p> <p><i>The Lost Sisters </i>is a companion novella-length audiobook to the <i>New York Times </i>best-selling novel <i>The Cruel Prince</i> by master writer Holly Black.</p>"; 
